import React from 'react';
import ReactDOM from 'react-dom';

const flname = "bansi khagram";

ReactDOM.render( 
    <React.Fragment> 
    <h1> My Name Is {flname} </h1>
    <p> my lucky num is {Math.random()} </p>
    </React.Fragment>, 
    document.getElementById("root"));
